import React, { useState } from 'react';

function App() {
  const [currentStep, setCurrentStep] = useState(1);
  const totalSteps = 7;

  // Form data state
  const [formData, setFormData] = useState({
    // Personal Information
    fullName: '',
    dateOfBirth: '',
    gender: '',
    identificationNumber: '',

    // Contact Information
    phoneNumber: '',
    email: '',
    address: '',

    // Emergency Contact
    emergencyName: '',
    emergencyPhone: '',
    emergencyRelation: '',

    // Program
    preferredProgram: '',
    joiningDate: '',

    // Accommodation
    requiresAccommodation: false,
    checkInDate: '',

    // Airport Pickup
    requiresPickup: false,
    arrivalDate: '',
    arrivalTime: '',

    // Additional
    photo: null
  });

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const renderStepContent = () => {
    switch(currentStep) {
      case 1:
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Full Name
              </label>
              <input 
                type="text"
                name="fullName"
                value={formData.fullName}
                onChange={handleInputChange}
                placeholder="Enter your full name"
                className={inputClassName}
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Date of Birth
              </label>
              <input 
                type="date"
                name="dateOfBirth"
                value={formData.dateOfBirth}
                onChange={handleInputChange}
                className={inputClassName}
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Gender
              </label>
              <select 
                name="gender"
                value={formData.gender}
                onChange={handleInputChange}
                className={inputClassName}
              >
                <option value="">Select Gender</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="other">Other</option>
              </select>
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                ID/Passport Number
              </label>
              <input 
                type="text"
                name="identificationNumber"
                value={formData.identificationNumber}
                onChange={handleInputChange}
                placeholder="Enter ID/Passport number"
                className={inputClassName}
              />
            </div>
          </div>
        );

      case 2:
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Phone Number
              </label>
              <input 
                type="tel"
                name="phoneNumber"
                value={formData.phoneNumber}
                onChange={handleInputChange}
                placeholder="Enter phone number"
                className={inputClassName}
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Email Address
              </label>
              <input 
                type="email"
                name="email"
                value={formData.email}
                onChange={handleInputChange}
                placeholder="Enter email address"
                className={inputClassName}
              />
            </div>
            <div className="md:col-span-2 space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Address
              </label>
              <textarea 
                name="address"
                value={formData.address}
                onChange={handleInputChange}
                placeholder="Enter your address"
                className={`${inputClassName} resize-none`}
                rows={3}
              />
            </div>
          </div>
        );

      case 3:
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Emergency Contact Name
              </label>
              <input 
                type="text"
                name="emergencyName"
                value={formData.emergencyName}
                onChange={handleInputChange}
                placeholder="Emergency contact name"
                className={inputClassName}
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Emergency Contact Phone
              </label>
              <input 
                type="tel"
                name="emergencyPhone"
                value={formData.emergencyPhone}
                onChange={handleInputChange}
                placeholder="Emergency contact phone"
                className={inputClassName}
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Relationship
              </label>
              <input 
                type="text"
                name="emergencyRelation"
                value={formData.emergencyRelation}
                onChange={handleInputChange}
                placeholder="Relationship to emergency contact"
                className={inputClassName}
              />
            </div>
          </div>
        );

      // Add more cases for remaining steps...
      default:
        return null;
    }
  };

  const getStepTitle = () => {
    switch(currentStep) {
      case 1: return "Personal Information";
      case 2: return "Contact Information";
      case 3: return "Emergency Contact";
      case 4: return "Program Enrollment";
      case 5: return "Accommodation";
      case 6: return "Airport Pickup";
      case 7: return "Additional Information";
      default: return "";
    }
  };

