      <div className="relative w-full max-w-4xl mx-auto mt-20 z-10">
        <div className="rounded-2xl shadow-2xl overflow-hidden">
          {/* Header Section */}
          <div className="relative p-8 bg-gradient-to-r from-[#1B3168] to-[#2A4580] after:absolute after:bottom-0 after:left-0 after:w-full after:h-1 after:bg-[#4CAF50]">
